import { LayoutContentWrapper } from '@iso/components/utility/layoutWrapper.style';
import CartTable from './CartTable';

export default function() {
  return (
    <LayoutContentWrapper>
      <CartTable className="bordered" />
    </LayoutContentWrapper>
  );
}
